/*
	There should be tinier particles that are only visible when you're REALLY zoomed in
	And you just explain A turns into B randomly, B into C when collides with C, and C into A


	But what exactly is a reaction diffusion system? Well, here I have a simulation of one, following essentially what Turing wrote in his paper
		it's quite interesting and dynamic
		You can make lots of pretty stuff with some fairly clear resemblence to different animals
		Especially if I change the colors
	The reason that we can make all of these patterns using a computer is because Alan Turing allowed us to understand them so well
		So what is our understanding? Well, we're going to zoom in and slow down
	Full of particles, just moving around randomly, which is what what molecules do all the time
	Now "diffusion" is very simple. I'm going to pause this a second.
	Suppose that for some reason you have a situation where, temporarily, we have a high concentration of one kind of molecule in one place like this
	This situation is exactly what you have when you put a drop of ink into water
	If we let time run forward, the ink spreads out of course, and eventually it's all completely equal
	And if we let time go forward, we see the same in this simulation
		Another fun example is when somebody farts, as captured by this thermal camera,
		Of course when someone farts, it will be smelly near them for a bit of time, but not forever, because their fart eventually becomes so spread out you can't smell it
		Same happens again when you introduce a warm thing into a cold environment
	Aaaaand this is what diffusion is, the spreading out of chemicals until everything is mixed

	The reaction part you can probably guess. Let's zoom in even further (only a few molecules visible)
	The chemicals that we can see now can transform into one another
		If a 0 		collides with a 0 			it turns into a red.
		If a red 	collides with two greens 	it turns into a green.
		If a green 	collides with a 1			it turns into a 1.
		Probably better to say they just randomly transform
	And with this happenning, we get all those nice interesting patterns again!
	Now all of these colors are standing in for real molecules, and the transformations happen for example because one molecule is losing an oxygen atom
		(pics) that you can buy for yourself and put in real test tubes, actually there are quite a few different chemicals that have basically this relationship to one another
		But Alan Turing, when he was talking about these, he said he really didn't care very much what the chemicals were at all
		That's a interesting thing to say and I'll come back to that.
		But the point is that these simple collisions and transformations are just something you have to accept can happen under certain circumstances,
		(video) possibly because an organism has evolved to have molecules that react exactly this way

	Zoom in again
	Now there are a variety of RD systems, a simple change would be to say that this thing has to bump into 3 rather than 2.
	this is the part that allows for the diversity of reaction diffusion systems (show all the videos), because there are many chemicals that react in lots of different ways
	But you can also have a 3D thing

	Features needed:
		Turn off reaction (i.e. make it heat)
		Speed control
		Control visibility of the boring ones
		Thick borders between cells?
		Change colors
		Switch to diffusion-only?
*/

